#family = [[22, 46360833, 0, 0, 'CELSR1', 'The protein encoded by this gene is a member of the flamingo subfamily, part of the cadherin superfamily. The flamingo subfamily consists of nonclassic-type cadherins; a subpopulation that does not interact with catenins. The flamingo cadherins are located at the plasma membrane and have nine cadherin domains, seven epidermal growth factor-like repeats and two laminin A G-type repeats in their ectodomain. They also have seven transmembrane domains, a characteristic unique to this subfamily. It is postulated that these proteins are receptors involved in contact-mediated communication, with cadherin domains acting as homophilic binding regions and the EGF-like domains involved in cell adhesion and receptor-ligand interactions. This particular member is a developmentally regulated, neural-specific gene which plays an unspecified role in early embryogenesis. [provided by RefSeq, Jul 2008]'], [1, 109250018, 0, 0, 'CELSR2', 'The protein encoded by this gene is a member of the flamingo subfamily, part of the cadherin superfamily. The flamingo subfamily consists of nonclassic-type cadherins; a subpopulation that does not interact with catenins. The flamingo cadherins are located at the plasma membrane and have nine cadherin domains, seven epidermal growth factor-like repeats and two laminin A G-type repeats in their ectodomain. They also have seven transmembrane domains, a characteristic unique to this subfamily. It is postulated that these proteins are receptors involved in contact-mediated communication, with cadherin domains acting as homophilic binding regions and the EGF-like domains involved in cell adhesion and receptor-ligand interactions. The specific function of this particular member has not been determined. [provided by RefSeq, Jul 2008]'], [3, 48636462, 0, 0, 'CELSR3', 'This gene belongs to the flamingo subfamily, which is included in the cadherin superfamily. The flamingo cadherins consist of nonclassic-type cadherins that do not interact with catenins. They are plasma membrane proteins containing seven epidermal growth factor-like repeats, nine cadherin domains and two laminin A G-type repeats in their ectodomain. They also have seven transmembrane domains, a characteristic feature of their subfamily. The encoded protein may be involved in the regulation of contact-dependent neurite growth and may play a role in tumor formation. [provided by RefSeq, Jun 2013]'], [16, 68644247, 1, 959, 'CDH3', 'This gene is a classical cadherin from the cadherin superfamily. The encoded protein is a calcium-dependent cell-cell adhesion glycoprotein comprised of five extracellular cadherin repeats, a transmembrane region and a highly conserved cytoplasmic tail. This gene is located in a six-cadherin cluster in a region on the long arm of chromosome 16 that is involved in loss of heterozygosity events in breast and prostate cancer. In addition, aberrant expression of this protein is observed in cervical adenocarcinomas. Mutations in this gene have been associated with congential hypotrichosis with juvenile macular dystrophy. [provided by RefSeq, Jul 2008]'], [20, 61252425, 0, 959, 'CDH4', 'This gene is a classical cadherin from the cadherin superfamily. The encoded protein is a calcium-dependent cell-cell adhesion glycoprotein comprised of five extracellular cadherin repeats, a transmembrane region and a highly conserved cytoplasmic tail. Based on studies in chicken and mouse, this cadherin is thought to play an important role during brain segmentation and neuronal outgrowth. In addition, a role in kidney and muscle development is indicated. Of particular interest are studies showing stable cis-heterodimers of cadherins 2 and 4 in cotransfected cell lines. Previously thought to interact in an exclusively homophilic manner, this is the first evidence of cadherin heterodimerization. Three transcript variants encoding different isoforms have been found for this gene. [provided by RefSeq, Nov 2011]'], [5, 31193654, 0, 959, 'CDH6', 'This gene encodes a member of the cadherin superfamily. Cadherins are membrane glycoproteins that mediate homophilic cell-cell adhesion and play critical roles in cell differentiation and morphogenesis. The encoded protein is a type II cadherin and may play a role in kidney development as well as endometrium and placenta formation. Decreased expression of this gene may be associated with tumor growth and metastasis. [provided by RefSeq, May 2011]'], [5, 21750863, 0, 959, 'CDH12', 'This gene encodes a type II classical cadherin from the cadherin superfamily of integral membrane proteins that mediate calcium-dependent cell-cell adhesion. Mature cadherin proteins are composed of a large N-terminal extracellular domain, a single membrane-spanning domain, and a small, highly conserved C-terminal cytoplasmic domain. Type II (atypical) cadherins are defined based on their lack of a HAV cell adhesion recognition sequence specific to type I cadherins. This particular cadherin appears to be expressed specifically in the brain and its temporal pattern of expression would be consistent with a role during a critical period of neuronal development, perhaps specifically during synaptogenesis. [provided by RefSeq, Jul 2008]'], [5, 69985098, 0, 959, 'CDH12P2', ''], [16, 82626793, 1, 804, 'CDH13', 'This gene encodes a member of the cadherin superfamily. The encoded protein is localized to the surface of the cell membrane and is anchored by a GPI moiety, rather than by a transmembrane domain. The protein lacks the cytoplasmic domain characteristic of other cadherins, and so is not thought to be a cell-cell adhesion glycoprotein. This protein acts as a negative regulator of axon growth during neural differentiation. It also protects vascular endothelial cells from apoptosis due to oxidative stress, and is associated with resistance to atherosclerosis. The gene is hypermethylated in many types of cancer. Alternative splicing results in multiple transcript variants encoding different isoforms. [provided by RefSeq, May 2011]'], [16, 89171754, 1, 732, 'CDH15', 'This gene is a member of the cadherin superfamily of genes, encoding calcium-dependent intercellular adhesion glycoproteins. Cadherins consist of an extracellular domain containing 5 cadherin domains, a transmembrane region, and a conserved cytoplasmic domain. Transcripts from this particular cadherin are expressed in myoblasts and upregulated in myotubule-forming cells. The protein is thought to be essential for the control of morphogenetic processes, specifically myogenesis, and may provide a trigger for terminal muscle cell differentiation. [provided by RefSeq, Jul 2008]'], [8, 94127165, 0, 732, 'CDH16', 'This gene is a member of the cadherin superfamily, genes encoding calcium-dependent, membrane-associated glycoproteins. The encoded protein is cadherin-like, consisting of an extracellular region, containing 7 cadherin domains, and a transmembrane region but lacking the conserved cytoplasmic domain. The protein is a component of the gastrointestinal tract and pancreatic ducts, acting as an intestinal proton-dependent peptide transporter in the first step in oral absorption of many medically important peptide-based drugs. The protein may also play a role in the morphological organization of liver and intestine. Alternative splicing results in multiple transcript variants. [provided by RefSeq, Jan 2009]'], [8, 94127165, 0, 732, 'CDH17', 'This gene is a member of the cadherin superfamily, genes encoding calcium-dependent, membrane-associated glycoproteins. The encoded protein is cadherin-like, consisting of an extracellular region, containing 7 cadherin domains, and a transmembrane region but lacking the conserved cytoplasmic domain. The protein is a component of the gastrointestinal tract and pancreatic ducts, acting as an intestinal proton-dependent peptide transporter in the first step in oral absorption of many medically important peptide-based drugs. The protein may also play a role in the morphological organization of liver and intestine. Alternative splicing results in multiple transcript variants. [provided by RefSeq, Jan 2009]'], [5, 19473030, 0, 732, 'CDH18', 'This gene encodes a type II classical cadherin from the cadherin superfamily of integral membrane proteins that mediate calcium-dependent cell-cell adhesion. Mature cadherin proteins are composed of a large N-terminal extracellular domain, a single membrane-spanning domain, and a small, highly conserved C-terminal cytoplasmic domain. Type II (atypical) cadherins are defined based on their lack of a HAV cell adhesion recognition sequence specific to type I cadherins. This particular cadherin is expressed specifically in the central nervous system and is putatively involved in synaptic adhesion, axon outgrowth and guidance. [provided by RefSeq, Jul 2008]'], [18, 66501082, 0, 732, 'CDH19', 'This gene is one of three related type II cadherin genes situated in a cluster on chromosome 18. The encoded protein is a calcium dependent cell-cell adhesion glycoprotein containing five extracellular cadherin repeats. Loss of cadherins may be associated with cancer formation. Alternative splicing results in multiple transcript variants for this gene. [provided by RefSeq, Aug 2012]'], [5, 141387884, 0, 732, 'CDH20', 'This gene is a member of the protocadherin gamma gene cluster, one of three related clusters tandemly linked on chromosome five. These gene clusters have an immunoglobulin-like organization, suggesting that a novel mechanism may be involved in their regulation and expression. The gamma gene cluster includes 22 genes divided into 3 subfamilies. Subfamily A contains 12 genes, subfamily B contains 7 genes and 2 pseudogenes, and the more distantly related subfamily C contains 3 genes. The tandem array of 22 large, variable region exons are followed by a constant region, containing 3 exons shared by all genes in the cluster. Each variable region exon encodes the extracellular region, which includes 6 cadherin ectodomains and a transmembrane region. The constant region exons encode the common cytoplasmic region. These neural cadherin-like cell adhesion proteins most likely play a critical role in the establishment and function of specific cell-cell connections in the brain. This particular family member is expressed in fibroblasts and is thought to play a role in wound healing in response to injury. Alternative splicing has been described for the gamma cluster genes. [provided by RefSeq, Jul 2008]'], [20, 46173732, 0, 732, 'CDH22', 'This gene is a member of the cadherin superfamily. The gene product is composed of five cadherin repeat domains and a cytoplasmic tail similar to the highly conserved cytoplasmic region of classical cadherins. Expressed predominantly in the brain, this putative calcium-dependent cell adhesion protein may play an important role in morphogenesis and tissue formation in neural and non-neural cells during development and maintenance of the brain and neuroendocrine organs. [provided by RefSeq, Jul 2008]'], [5, 19473030, 0, 732, 'CDH24', 'This gene encodes a type II classical cadherin from the cadherin superfamily of integral membrane proteins that mediate calcium-dependent cell-cell adhesion. Mature cadherin proteins are composed of a large N-terminal extracellular domain, a single membrane-spanning domain, and a small, highly conserved C-terminal cytoplasmic domain. Type II (atypical) cadherins are defined based on their lack of a HAV cell adhesion recognition sequence specific to type I cadherins. This particular cadherin is expressed specifically in the central nervous system and is putatively involved in synaptic adhesion, axon outgrowth and guidance. [provided by RefSeq, Jul 2008]'], [20, 59958415, 0, 732, 'CDH26', 'Cadherins are a family of adhesion molecules that mediate Ca2+-dependent cell-cell adhesion in all solid tissues and modulate a wide variety of processes, including cell polarization and migration. Cadherin domains occur as repeats in the extracellular region and are thought to contribute to the sorting of heterogeneous cell types and the maintenance of orderly structures such as epithelium. This gene encodes a cadherin domain-containing protein whose specific function has not yet been determined. Alternative splicing occurs at this locus and two transcript variants, encoding distinct proteins, have been identified. [provided by RefSeq, Jul 2008]'], [21, 34516441, 0, 732, 'DSC1', 'The protein encoded by this gene interacts with calcineurin A and inhibits calcineurin-dependent signaling pathways, possibly affecting central nervous system development. This gene is located in the minimal candidate region for the Down syndrome phenotype, and is overexpressed in the brain of Down syndrome fetuses. Chronic overexpression of this gene may lead to neurofibrillary tangles such as those associated with Alzheimer disease. Alternative splicing results in multiple transcript variants. [provided by RefSeq, Nov 2013]'], [18, 31065975, 0, 732, 'DSC2', 'The protein encoded by this gene is a calcium-dependent glycoprotein that is a member of the desmocollin subfamily of the cadherin superfamily. These desmosomal family members, along with the desmogleins, are found primarily in epithelial cells where they constitute the adhesive proteins of the desmosome cell-cell junction and are required for cell adhesion and desmosome formation. The desmosomal family members are arranged in two clusters on chromosome 18, occupying less than 650 kb combined. Mutations in this gene are associated with arrhythmogenic right ventricular dysplasia-11. Alternative splicing results in two transcript variants encoding distinct isoforms. [provided by RefSeq, Jul 2008]'], [18, 31065975, 0, 732, 'DSC3', 'The protein encoded by this gene is a calcium-dependent glycoprotein that is a member of the desmocollin subfamily of the cadherin superfamily. These desmosomal family members, along with the desmogleins, are found primarily in epithelial cells where they constitute the adhesive proteins of the desmosome cell-cell junction and are required for cell adhesion and desmosome formation. The desmosomal family members are arranged in two clusters on chromosome 18, occupying less than 650 kb combined. Mutations in this gene are associated with arrhythmogenic right ventricular dysplasia-11. Alternative splicing results in two transcript variants encoding distinct isoforms. [provided by RefSeq, Jul 2008]'], [18, 31318088, 0, 732, 'DSG1', 'Desmosomes are cell-cell junctions between epithelial, myocardial and certain other cell types. Desmoglein 1 is a calcium-binding transmembrane glycoprotein component of desmosomes in vertebrate epithelial cells. Currently, three desmoglein subfamily members have been identified and all are members of the cadherin cell adhesion molecule superfamily. These desmoglein gene family members are located in a cluster on chromosome 18. The protein encoded by this gene has been identified as the autoantigen of the autoimmune skin blistering disease pemphigus foliaceus. [provided by RefSeq, Jul 2008]'], [18, 31498063, 0, 732, 'DSG2', 'Desmosomes are cell-cell junctions between epithelial, myocardial, and certain other cell types. This gene product is a calcium-binding transmembrane glycoprotein component of desmosomes in vertebrate epithelial cells. Currently, three desmoglein subfamily members have been identified and all are members of the cadherin cell adhesion molecule superfamily. These desmoglein gene family members are located in a cluster on chromosome 18. This second family member is expressed in colon, colon carcinoma, and other simple and stratified epithelial-derived cell lines. Mutations in this gene have been associated with arrhythmogenic right ventricular dysplasia, familial, 10. [provided by RefSeq, Jul 2008]'], [18, 31447768, 0, 732, 'DSG3', 'Desmosomes are cell-cell junctions between epithelial, myocardial, and certain other cell types. Desmoglein 3 is a calcium-binding transmembrane glycoprotein component of desmosomes in vertebrate epithelial cells. Currently, three desmoglein subfamily members have been identified and all are members of the cadherin cell adhesion molecule superfamily. These desmoglein gene family members are located in a cluster on chromosome 18. This protein has been identified as the autoantigen of the autoimmune skin blistering disease pemphigus vulgaris. [provided by RefSeq, Jul 2008]'], [18, 31376776, 0, 732, 'DSG4', 'This gene encodes a member of the desmoglein subgroup of desmosomal cadherins. The encoded protein is a transmembrane component in desmosomes and may play a role in cell-cell adhesion in epithelial cells. Mutations in the gene are associated with localized autosomal recessive hypotrichosis and potentially in other skin disorders. Alternate splicing results in multiple transcript variants. [provided by RefSeq, Sep 2009]'], [16, 68737291, 1, 958, 'CDH1', 'This gene is a classical cadherin from the cadherin superfamily. The encoded protein is a calcium dependent cell-cell adhesion glycoprotein comprised of five extracellular cadherin repeats, a transmembrane region and a highly conserved cytoplasmic tail. Mutations in this gene are correlated with gastric, breast, colorectal, thyroid and ovarian cancer. Loss of function is thought to contribute to progression in cancer by increasing proliferation, invasion, and/or metastasis. The ectodomain of this protein mediates bacterial adhesion to mammalian cells and the cytoplasmic domain is required for internalization. Identified transcript variants arise from mutation at consensus splice sites. [provided by RefSeq, Jul 2008]'], [18, 27950965, 0, 958, 'CDH2', 'This gene is a classical cadherin from the cadherin superfamily. The encoded protein is a calcium dependent cell-cell adhesion glycoprotein comprised of five extracellular cadherin repeats, a transmembrane region and a highly conserved cytoplasmic tail. The protein functions during gastrulation and is required for establishment of left-right asymmetry. At certain central nervous system synapses, presynaptic to postsynaptic adhesion is mediated at least in part by this gene product. [provided by RefSeq, Jul 2008]'], [16, 66366621, 1, 984, 'CDH5', 'This gene is a classical cadherin from the cadherin superfamily and is located in a six-cadherin cluster in a region on the long arm of chromosome 16 that is involved in loss of heterozygosity events in breast and prostate cancer. The encoded protein is a calcium-dependent cell-cell adhesion glycoprotein comprised of five extracellular cadherin repeats, a transmembrane region and a highly conserved cytoplasmic tail. Functioning as a classic cadherin by imparting to cells the ability to adhere in a homophilic manner, the protein may play an important role in endothelial cell biology through control of the cohesion and organization of the intercellular junctions. An alternative splice variant has been described but its full length sequence has not been determined. [provided by RefSeq, Jul 2008]']]
